package modules::Polyphen;

use strict;
use modules::Exception;
use modules::SystemCall;
use modules::Annotation;
use Data::Dumper;

sub new {
    my ($class, @args) = @_;

    my %args = @args;

    my $self = bless {}, $class;

	my @required_args = (
			             -input_mapped_file,
    					 -input_unmapped_file,
						 -working_dir,
						 -config_path
						 );

    foreach my $required_arg (@required_args){

		if (! defined $args{$required_arg}){
		    modules::Exception->throw("Required argument [$required_arg] not set");
		}		
		(my $short_args = $required_arg) =~ s/^\-//;
		my $full_path = `readlink -f $args{$required_arg}`;
		chomp $full_path;
		$self->{$short_args} = $full_path;
    }

	#Set the optional values
	$self->executable_path($args{-executable_path});
	$self->fasta($args{-fasta});
    return $self;
}

#Set the fasta file for unmapped snvs
sub fasta {
    my ($self, $fasta) = @_;

    if ( defined $fasta ){
    	my $full_path = `readlink -f $fasta`;
		chomp $full_path;
		$self->{'fasta'} = $full_path;
    } elsif (! defined $self->{'fasta'}) {
		$self->{'fasta'} = $self->{working_dir} . '/polyphen.fa';
    }

    return $self->{'fasta'};
}


sub executable_path {
    my ($self, $executable_path) = @_;

    if (defined $executable_path 
	&& -x $executable_path){
		$self->{'executable_path'} = $executable_path;
    } elsif (! defined $self->{'executable_path'}) {
		$self->{'executable_path'} = 'pph';
    }

    return $self->{'executable_path'};
}

sub generate_input {
	
	my $self = shift;
	my %args = @_;
	
	my @required_args = (
			             -overlap,
			             -fh
						 );

    foreach my $required_arg (@required_args){

		if (! defined $args{$required_arg}){
		    modules::Exception->throw("Required argument [$required_arg] not set");
		}
    }
	
	my $mapped = defined $args{-mapped}?$args{-mapped}:1;
	my $overlaps = $args{-overlap};
	#print Dumper $overlaps;
	my $fh = $args{-fh};
	my $fasta_fh;
	if (!$mapped && !defined $args{-fh_fasta}) {
		modules::Exception->throw("Need to define fasta fh when using unmapped snvs");
	} else {
		$fasta_fh = $args{-fh_fasta};
	}
	
	for my $chr (sort keys %{$overlaps->{PASS}}) {
		for my $overlap_coord (sort {$a<=>$b} keys %{$overlaps->{PASS}{$chr}}) {
			for my $snv_str (keys %{$overlaps->{PASS}{$chr}{$overlap_coord}{$overlap_coord}}) {
				my @snv_fields = split(":",$snv_str);
				my ($snv_refbase,$snv_varbase) = split('->',$snv_fields[2]);
				
				#Just use the first entry in cases of multiple ccds to swissprot mapping; since the same coordinate is covered the products will be the same at this base
				my ($aa_string) = @{$overlaps->{PASS}{$chr}{$overlap_coord}{$overlap_coord}{$snv_str}};
				my @aa_fields = split(':',$aa_string);
				my ($uniprot,$aa_pos,$original_aa,$three_bases,$aa_refbase,$base_position,$strand,$mapped_name,$aa_seq) = @aa_fields;
				if ($aa_seq) {
					if ($aa_seq =~ /SEQ_TOO/) {
						$aa_seq = &hack_lookup($uniprot);					
					} else {
						$aa_seq =~ s/_//g if $aa_seq;
					}
				}
				
				#my ($uniprot,$aa_pos,$original_aa,$three_bases,$aa_refbase,$base_position,$strand,$aa_seq) = @aa_fields;
				if ($snv_refbase ne $aa_refbase) {
					modules::Exception->throw("ERROR: Problem with entry $snv_str $aa_string: Refbase disagrees\n");
				}
				my @forward_bases = split("",$three_bases);
				
				#Substitute the new base (input is always on the forward strand)
				$forward_bases[$base_position] = $snv_varbase;
				my $new_bases;
				
				if ($strand eq '-') {
					#Reverse compliment
					$new_bases = modules::Utils->revcom(join("",@forward_bases));
				} else {
					$new_bases = join("",@forward_bases);
				}
				
				my $new_aa = modules::Utils->translate($new_bases);
						
				my $check_aa_change = $original_aa . '->' . $new_aa;
						
				#Polyphen doesn't handle nonsense mutations			
				if ($new_aa eq '_') {
					next;
				}		
				#If there are staggered transcript and one of them doesn't result in ns snv skip
				if ($original_aa eq $new_aa) {
					next;
				}
				#only perform this check with standard pipeline (filter_polyphen.pl) code; standalone version doesn't have this info to check	
#				if (@snv_fields > 3) {
#					if ($check_aa_change ne $snv_fields[3]) {
#						#This doesn't work with ccds in different reading frames
#						modules::Exception->warn("WARNING: Problem with entry $snv_str $aa_string: AA change disagrees ($check_aa_change $snv_fields[3])\n");
#					}		
#				}
				my $unique_name = $snv_str.':'.$aa_string;
				
				
				if ($mapped) {
					print $fh join("\t", 
								$unique_name,
								$uniprot,
								$aa_pos,
								$original_aa,
								$new_aa,
								) . "\n";					
				} else {
					$unique_name =~ s/:[A-Z]+$//;
					(my $fasta_header = $snv_str) =~ s/\>//g;
					print $fh join("\t", 
								$unique_name,
								$fasta_header,
								$aa_pos,
								$original_aa,
								$new_aa,
								) . "\n";	
								
					print $fasta_fh join("\n",
										">$fasta_header",
										$aa_seq	
										). "\n";
				}		
				
					
			}
				
		}
	}
	
}

#Run the polyphen command (single processor mode)
sub run {
    my $self = shift;

	my %args = @_;

	#Contains fasta args for unmapped snvs
	my $fasta_args;
	#Input changes depending on mapped vs unmapped
	my $input_file;
	#Write to file or stderr
	my $output_args;
	
	#Mapped_flag
	my $mapped = 1;
	
	#Default is mapped entries
	if (defined $args{-mapped} && $args{-mapped} == 0) {
		$input_file = $self->{input_unmapped_file};
		$fasta_args = " -s $self->{fasta}";
		$mapped = 0;
	} else {
		$input_file = $self->{input_mapped_file};	
	}

    my $command 
	= $self->executable_path 
	. ' -d ' . $self->{working_dir}
	. ' -c ' .$self->{config_path}
	. ' ' . $input_file;
	
	#Add the fasta file if unmapped
	if (!$mapped) {
		$command =~ s/ / $fasta_args /;
	}
	#Add the output file if to output file
	if (defined $args{-output}) {
		$command .= "> $args{-output}"; 
	}

    print STDERR "Running command: $command\n";

    if (system($command)){
		modules::Exception->throw("Command: $command\nError: Non-zero exit status.")
    }

    return 1;
}


#Parse the output and return the useful results
sub parse_result {
    my $self = shift;
	my %args = @_;
	
	my @required_args = (
			             -output
						 );

    foreach my $required_arg (@required_args){

		if (! defined $args{$required_arg}){
		    modules::Exception->throw("Required argument [$required_arg] not set");
		}		
    }
    open(my $OUTPUT, $args{-output}) || modules::Exception->throw("Can't open polyphen output file $args{-output}");

    my @parsed_result;

    while (<$OUTPUT>){
		chomp;
		next if /o_snp_id/;
		my @fields = split("\t");
		my ($name,$prediction,$score)	 = @fields[0,12,16];
		my ($chr,$start,$nt_change) = split(':',$name);
		$score =~ s/ //g;
		$prediction =~ s/ //g;
		$name =~ s/ //g;
		$self->{results}->{$chr}{$start}{$nt_change}{score} = $score;
		$self->{results}->{$chr}{$start}{$nt_change}{prediction} = $prediction;
		$self->{results}->{$chr}{$start}{$nt_change}{name} = $name;
    }

    close($OUTPUT);
}

sub get_results {
	my $self = shift;
	return $self->{results};
}

